  CONSTRAINT `productorderitem_ibfk_3` FOREIGN KEY (`productorderitem_user_id`) REFERENCES `user` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=305 DEFAULT CHARSET=utf8;

